import axios from 'axios';

export default function GetSearch(query){
    //Make Search Request to axios on public search
    const searchUrl = 'http://www.facebook.com/public/'+ query;
    const headers = {
        "Cookie": "fr=1Anotbfe7tnr0lkVj..Bemgoj.pV.AAA.0.0.BemhJm.AWUzGWM-",
        "Cache-Control": "no-cache",
        "Accept": "*/*",
        "Accept-Encoding": "gzip, deflate, br",
        "User-Agent": "PostmanRuntime/7.24.1",
        "Connection": "keep-alive"
    };
    axios.get(searchUrl, {mode:'no-cors', headers: headers,timeout: 5000, credentials: 'same-origin'}).then((response)=>{
